// SPDX-License-Identifier: MIT
pragma solidity >=0.5.0 <0.9.0;

contract Voting {
    struct Contestant {
        uint id;
        string name;
        uint voteCount;
        string party;
        uint age;
        string qualification;
    }

    struct Voter {
        bool hasVoted;
        //uint vote;
        bool isRegistered;
    }

    address admin;
    mapping(uint => Contestant) public contestants;
    // mapping(address => bool) public voters;
    mapping(address => Voter) public voters;
    uint public contestantsCount;
    // uint public counter;
    enum PHASE {
        reg,
        voting,
        done
    }
    PHASE public state;

    modifier onlyAdmin() {
        require(msg.sender == admin);
        _;
    }

    modifier validState(PHASE x) {
        require(state == x);
        _;
    }

    constructor() {
        admin = msg.sender;
        state = PHASE.reg;
        // counter = 0;
    }

    function changeState(PHASE x) public onlyAdmin {
        require(x > state);
        state = x;
    }

    function addContestant(
        string memory _name,
        string memory _party,
        uint _age,
        string memory _qualification
    ) public onlyAdmin validState(PHASE.reg) {
        contestantsCount++;
        contestants[contestantsCount] = Contestant(
            contestantsCount,
            _name,
            0,
            _party,
            _age,
            _qualification
        );
    }

    function voterRegisteration(
        address user
    ) public onlyAdmin validState(PHASE.reg) {
        voters[user].isRegistered = true;
    }

    function vote(uint _contestantId) public validState(PHASE.voting) {
        require(voters[msg.sender].isRegistered);
        require(!voters[msg.sender].hasVoted);
        require(_contestantId > 0 && _contestantId <= contestantsCount);
        contestants[_contestantId].voteCount++;
        voters[msg.sender].hasVoted = true;
        //voters[msg.sender].vote = _contestantId;
    }
    function winner() public view validState(PHASE.done) returns (uint) {
        uint maxVotes = 0;
        uint currentWinnerId = 0;
        bool hasWinner = false;
        for (uint i = 1; i <= contestantsCount; i++) {
            if (contestants[i].voteCount > maxVotes) {
                maxVotes = contestants[i].voteCount;
                currentWinnerId = i;
                hasWinner = true;
            } else if (contestants[i].voteCount == maxVotes) {
                hasWinner = false;
            }
        }
        if (hasWinner) {
            return currentWinnerId;
        } else {
            return 0;
        }
    }
    function getVoteCounts()
        public
        view
        validState(PHASE.done)
        returns (uint[] memory)
    {
        uint[] memory voteCounts = new uint[](contestantsCount);
        for (uint i = 1; i <= contestantsCount; i++) {
            voteCounts[i - 1] = contestants[i].voteCount;
        }
        return voteCounts;
    }
}
